  return (
    <nav class="navbar navbar-light bg-light">
      <div class="container-fluid">
        <form class="d-flex">
          <input
            class="form-control me-2"
            type="search"
            placeholder="Search"
            aria-label="Search"
          />
          <button class="btn btn-dark" type="submit">
            Search
          </button>
        </form>
        <span>
          Username <i class="bi bi-person-circle"></i>
        </span>
      </div>
    </nav>
  );
}
